import styled from "styled-components";
import React from 'react';
import Header from "./Header";

const Home = (props) => {
  return (
    <div>
      <Header />
      <Container>
        <Section>
          <h5>
            <a href="">Hiring in a hurry!</a>
          </h5>
          <p>Find talented pros in record time with Upwork and business movement!</p>
        </Section>
      </Container>
    </div>
  );
}
const Container = styled.div`
  padding-top: 52px;
`;
const Section = styled.section``;
export default Home;
